import React from 'react';
import { Route, Switch } from 'react-router';
import Password from './Password';

const Padding = styled.div`
    padding: ${({padding}) => padding};
`

const App = () => <Padding>
    <Switch>
    <Route path="/:id/:floor" component={Password} />
</Switch>
</Padding>


export default App;
